Actionscript.script:
stop();
_root.warpframe = false;
onEnterFrame = function () {
	if (this.warp1.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 1;
	}
	if (this.warp2.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 2;
	}
	if (this.warp3.hitTest(_root.Course.Char.charClip.feet)) {
		_root.Course.Char.attack = true;
		_root.Course.Char.xspeed = 0;
		_root.Course.Char.yspeed = 0;
		_root.Course.Char.attackFrame = "none";
		warp = true;
		warpnum = 3;
	}
	if (warp == true && _root.warpframe == false) {
		if (warpnum == 1) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		if (warpnum == 2) {
			_root.attachMovie("righttransition", "righttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		if (warpnum == 3) {
			_root.attachMovie("lefttransition", "lefttransition"+_root.getNextHighestDepth(), _root.getNextHighestDepth(), {_x:_root.screensizeX/2, _y:_root.screensizeY/2});
		}
		warp = false;
	}
	if (_root.warpframe == true) {
		if (warpnum == 1) {
			_root.changecourse("lefttransition2", "5-4", 1765, _root.Course.Char._y-_root.Course.BackGFX._y, 1765, _root.Course.Char._y-_root.Course.BackGFX._y);
		}
		if (warpnum == 2) {
			_root.changecourse("righttransition2", "5-1", -280, _root.Course.Char._y-_root.Course.BackGFX._y+160, -280, _root.Course.Char._y-_root.Course.BackGFX._y+160);
		}
		if (warpnum == 3) {
			_root.changecourse("lefttransition2", "5-3", 0, 0, 0, 0);
		}
		//_root.warpframe = false;                           
	}
};

onClipEvent (load) {
	frame = 10;
	deepness = 450;
	fallspeed1 = 0.05;
	fallspeed2 = 0.97;
	risespeed1 = 0.2;
	risespeed2 = 0.9;
	sinktime = 320
}

onClipEvent (load) {
	invis = true;
	starnum = 24;
	timecount = 0;
	//
	if (_root.Course.coincountnum == undefined) {
		_root.Course.coincountnum = 0;
	} else {
		_root.Course.coincountnum++;
	}
	if (_root["coindata"+_root.playingcourse][0] == undefined) {
		_root["coindata"+_root.playingcourse] = [""];
	}
	coinnum = _root.Course.coincountnum;
	if (_root["coindata"+_root.playingcourse][coinnum] == 1) {
		invis = false;
	}
}
onClipEvent (enterFrame) {
	timecount++;
	if (_root.RedCoins>=8 && timecount>12) {
		_root["coindata"+_root.playingcourse][coinnum] = 1;
		invis = false;
	}
}

onClipEvent (load) {
	DirectionX = "Left";
	DirectionY = "Up";
	distanceX = 0
	distanceY = 500
	accelX = 0
	accelY = 2
	speedX = 0
	speedY = 4
	scale = 1;
	//
	disapearcount = 60;
}

onClipEvent (load) {
	DirectionX = "Left";
	DirectionY = "Up";
	distanceX = 164/4
	distanceY = 164/4
	accelX = 1
	accelY = 1
	speedX = 4
	speedY = 4
	scale = 1;
	//
	disapearcount = 164/4-4
}

onClipEvent (load) {
	starfunction = function () {
		_root.StartNewMusicAndIntroNoVar("MetalCap - Intro", "MetalCap - Repeat");
		_root.PowerTimer = 32*30;
		_root.Metal = true;
	};
}
